Society SMSSM - Dec 05, 2012 - Kymberly Jane


Mp4 + Pics


Kymberly's been making the rounds here at DungeonCorp lately, but today she's getting the grand tour...The Grand Tour of Pain that is. And on this day her tour guide through Hell is none other than Ogre. Now Kymberly's a specimen. A perfect body. And Ogre pulls out all the stops exploring it and putting her through her paces. She seems to have a fighting spirit, and that serves all the better, providing plenty of orgasmic tension. She may be strong and defiant, and she may be willing to hang tough, but it's only a matter of time before she's broken...And Ogre is certainly up to the challenge. In the end she shall comply, and she will be kicking and screaming all the way


